import React from 'react'
import './index.less'
import {Card, Button, Icon} from 'antd'
export default class Details extends React.Component {

    handleClick = () => {
        window.location.href = '/#/admin/record';
    }

    render() {
        return (
            <div className="container">
                <Card className="cardWrap" bordered={false} bodyStyle={{padding: "24px 0"}}>
                    <Button className="returnBtn" onClick={this.handleClick}><Icon type="arrow-left"/>Medical Record / Add a new record</Button>
                </Card>
                <Card className="cardWrap" bordered={false} bodyStyle={{padding: "24px 0"}}>
                    <div style={{fontSize: '24px'}}>Attachments</div>
                    <div>
                        <Card className="cardWrap">
                            <div>Record 01</div>
                            <div>Record 02</div>
                        </Card>
                    </div>
                </Card>
            </div>
        );
    }
}
